import { FieldId, ObjectId } from '@salesforce/schema';
/**
 * Module resolver for @salesforce/schema/* that provides access to force.com SObjects and field identifiers.
 *
 * The supported module identifiers are dependent on the sObject schema in the org:
 * 1. sObject schema in a namespace: @salesforce/schema/[namespace]__[objectApiName]
 * 2. sObject schema in default ('c') namespace: @salesforce/schema/[objectApiName]
 * 3. Field schema in a namespace: @salesforce/schema/[namespace]__[objectApiName].[namespace]__[fieldApiName]
 * 4. Field schema in default ('c') namespace: @salesforce/schema/[objectApiName].[fieldApiName]
 * 5. Spanning field schema in a namespace: @salesforce/schema/[namespace]__[objectApiName].[namespace]__[relationshipApiName].[namespace]__[fieldApiName]
 * 6. Spanning field schema in default ('c') namespace: @salesforce/schema/[objectApiName].[relationshipApiName].[fieldApiName]
 *
 * @param resource The module identifier.
 * @returns The value of the requested resource.
 */
export default function schemaResolver(resource: string): FieldId | ObjectId | undefined;
